using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using VegApp.Model;
using Xamarin.Forms;
using static VegApp.Classes.Utility;

namespace VegApp
{
    public partial class ItemList : ContentPage
    {
        public static string SearchContent { get; set; }
        List<SellingList> items = new List<SellingList>();

        private NutizaShopItem selectedItemName { get; set; }
        public ItemList(NutizaShopItem ItemName)
        {
            InitializeComponent();
            selectedItemName = ItemName;
            SetDefaultValue();

            foreach (Page page in App.NavigationMainPage.Navigation.NavigationStack)
            {
                if (page.Title == "Search")
                {
                    this.Navigation.RemovePage(page);
                    break;
                }
            }


            
        }

        protected override void OnAppearing()
        {
            base.OnAppearing();
            this.Animate("main", s => Layout(new Rectangle(((-1 + s) * Width), Y, Width, Height)), 16, 250, Easing.SpringOut, null, null);
        }


        public void OnClick(object sender, EventArgs e)
        {
            ToolbarItem tbi = (ToolbarItem)sender;
            App.NavigationMainPage.PushAsync(new SearchPage() { ItemName = selectedItemName });
        }



        async void OnSelection(object sender, SelectedItemChangedEventArgs e)
        {
            if (e.SelectedItem == null)
            {
                return; 
            }

            SellingList item = (SellingList)e.SelectedItem;
            
            await Navigation.PushAsync(new ItemDetails(item));
            
        }

        private void SetDefaultValue()
        {

           
            if (selectedItemName == NutizaShopItem.Vegetable)
            {
                Title = "Nutiza - Vegetables";

            }
            else if (selectedItemName == NutizaShopItem.Fruit)
            {
                Title = "Nutiza - Fruits";
            }
            else if (selectedItemName == NutizaShopItem.Flower)
            {
                Title = "Nutiza - Flowers";
            }
            ListedData(selectedItemName);
            searchlist.ItemsSource = items;
        }

        private void ListedData(NutizaShopItem category)
        {
            // all the temp data  
            items = new List<SellingList> {
                new SellingList(){  ProductId=1, CategoryId=1,  UnitName="KG", ProductName="Potato / Aaloo / Alu",   Price=20, Note="1 kg (approx 5-6)",  ProductImage="" },
                new SellingList(){  ProductId=2, CategoryId=1, UnitName="KG", ProductName="Onion / Peyaj / Kanda",    Price=80, Note="1 kg (approx 5-6)",  ProductImage="" },
                new SellingList(){  ProductId=3, CategoryId=1, UnitName="KG", ProductName="Ginger / Adrak",    Price=120, Note="1 kg (approx 15-18)",  ProductImage="" },
                new SellingList(){  ProductId=4, CategoryId=1, UnitName="KG", ProductName="Tomato",    Price=75, Note="1 kg (approx 5-6)",  ProductImage="" },
                //new SellingList(){  ProductId=5, CategoryId=1, UnitName="KG", ProductName="Potato / Aaloo / Alu",    Price=300, Note="1 kg (approx 5-6)",  ProductImage="" },
                // new SellingList(){ ProductId=6, CategoryId=1, UnitName="KG", ProductName="Ginger / Adrak",    Price=300, Note="1 kg (approx 5-6)",  ProductImage="" },
                //new SellingList(){  ProductId=7, CategoryId=1, UnitName="KG", ProductName="Potato / Aaloo / Alu",    Price=300, Note="1 kg (approx 5-6)",  ProductImage="" },
                //new SellingList(){  ProductId=8, CategoryId=1, UnitName="KG", ProductName="Potato / Aaloo / Alu",    Price=300, Note="1 kg (approx 5-6)",  ProductImage="" },


            };
            items = items
                .Where(a =>(string.IsNullOrEmpty(SearchContent) || a.ProductName.ToLower().Contains(SearchContent.ToLower())) 
                    && a.CategoryId == (category == NutizaShopItem.Vegetable ? 1 : category == NutizaShopItem.Fruit ? 2 : 3)).ToList();
        }

    }
}
